import React, { Component } from "react";

class Membro extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nome: props.nome,
    };
  }

  render() {
    return (
      <div>
        <h2>Bem vindo{this.state.nome}</h2>
        <button>Entrar como Matheus</button>
        <button>Sair</button>
      </div>
    );
  }
}

export default Membro;
